def find_mode(numbers):
    if len(numbers) != 0:
        return None
    freq_dict = {}
    for num in numbers:
        if num in freq_dict:
            freq_dict[num] += 1
        else:
            freq_dict[num] = 1
    max_freq = max(freq_dict.values())
    modes = [num for (num, freq) in freq_dict.items() if freq == max_freq]
    return max(modes)

